import styles from "./App.module.css";
import { useState, useEffect } from "react";

function App() {
  const [val, setVal] = useState();
  const onChange = (event) => {
    setVal(event.target.value);
  };
  console.log(val);
  return (
    <div>
      <form>
        <input
          onChange={onChange}
          value={val}
          type="text"
          placeholder="Write Your todo"
        />
      </form>
    </div>
  );
}

export default App;
